usr/gitc/picard.jar \
 ValidateSamFile \
 INPUT=${input_bam} \
 OUTPUT=${report_filename} \
 MODE=VERBOSE \
 IS_BISULFITE_SEQUENCED=false 
 }
 runtime {
 docker: "broadinstitute/genomes-in-the-cloud:2.2.3-1469027018"
 disks: "local-disk " + disk_size + " HDD"
 memory: "3500 MB"
 }
 output {
 File report = "${report_filename}"
 }
}

workflow BamToUnmappedBams {
 File input_bam
 String dir_pattern = "gs://.*/"
 #String dir_pattern = "/.*/"
 Int revert_sam_disk_size = 400
 Int sort_sam_disk_size = 400
 Int validate_sam_file_disk_size = 200

 call RevertSam {
 input:
 input_bam = input_bam,
 revert_bam_name = sub(sub(input_bam, dir_pattern, ""), ".bam$", "") + ".unmapped.bam",
 disk_size = revert_sam_disk_size
 }

# call SortSam {
# input:
# input_bam = RevertSam.unmapped_bam,
# sorted_bam_name = sub(sub(RevertSam.unmapped_bam, dir_pattern, ""), ".bam$", "") + ".sorted.bam",
# disk_size = sort_sam_disk_size
# }

 call ValidateSamFile {
 input:
 input_bam = RevertSam.unmapped_bam,
 report_filename = sub(sub(RevertSam.unmapped_bam, dir_pattern, ""), ".unmapped.bam$", "") + ".validation_report",
 disk_size = validate_sam_file_disk_size
 }

 output {
 RevertSam.*
 ValidateSamFile.*
 }
